import React from 'react';
import ISLogo from "../img/ecotracklogo.png";
import { makeStyles } from '@mui/styles';
import Typography from '@mui/material/Typography';
import Link from '@mui/material/Link';


const footerStyle = makeStyles({
    footer: {
        display: 'absolute',
        position: 'fixed',
        bottom: '0px',
        left: '0px',
        margin: 'auto',
        textAlign: 'center',
        backgroundColor: '#F1F2ED',
    },

    copyright: {
        position: 'fixed',
        bottom: '0px',
        textAlign: 'center',
        width: '100%',
        backgroundColor: '#F1F2ED'
    },

    logo:{
        position: 'sticky',
        width: '200px',


        maxWidth: '100%',

    }
})

function Copyright(props) {
    return (
      <Typography variant="body2" color="text.secondary" align="center" {...props}>
        {'Copyright © '}
        <Link color="inherit" href="https://infosys.com/">
          Infosys Eco Track Project
        </Link>{' '}
        {2023}
        {'.'}
      </Typography>
    );
  }

export default function footer() {
    const classes = footerStyle();
  return (
    <>
        <div className={classes.footer}>
            <div>   
                <a herf="https://infosys.com/">
                    <img src={ISLogo} alt='infoysyslogo' className={classes.logo}/>
                </a>
            </div>
            <div>
                <Copyright className={classes.copyright} sx={{ mt: 5 }}/>
            </div>

        </div>
    </>
  )
}
